youtube = build('youtube', 'v3',)
next_page_token = None
total_results = []

while True:
    search_response = youtube.search().list(
        q='Tom Brady highlights',
        type='video',
        part='id',
        maxResults=50,
        pageToken=next_page_token
    ).execute()

    video_ids = [item['id']['videoId'] for item in search_response['items']]
    total_results.extend(video_ids)

    next_page_token = search_response.get('nextPageToken')
    if not next_page_token:
        break

base = 'https://www.youtube.com/watch?v='

# print(search_responses['items'][0])

for i in range(len(total_results)):
  total_results[i] = base + total_results[i]

idx = 0
for i in range(len(total_results)):
  if total_results[i] == 'https://www.youtube.com/watch?v=Mq6Sba8yZ0A':
    idx = i + 1

valid_results = total_results[0:idx]
print(valid_results)


